package ui

import (
	"fmt"
	"fyne.io/fyne/v2"
	"fyne.io/fyne/v2/container"
	"fyne.io/fyne/v2/dialog"
	"fyne.io/fyne/v2/widget"
	"io"
)

type main struct {
	app    fyne.App
	parent fyne.Window
}

func uiMain(app fyne.App, parent fyne.Window) *main {
	return &main{
		app:    app,
		parent: parent,
	}
}

func (m *main) buildUI() *fyne.Container {
	getHashButton := widget.NewButton("Get Hash", m.getHash)
	getHashButton.Resize(fyne.NewSize(200, 30))
	getHashButton.Move(fyne.NewPos(50, 50))
	return container.NewVBox(
		getHashButton,
	)
}

func (m *main) getHash() {
	var data []byte
	fmt.Println(data)
	data = m.getDataFromFile()
	fmt.Println(data)
}

func (m *main) getDataFromFile() []byte {
	dataChan := make(chan []byte)
	go func() {
		fopenDialog := dialog.NewFileOpen(
			func(file fyne.URIReadCloser, err error) {
				defer func() {
					if file != nil {
						file.Close()
					}
				}()
				if err != nil {
					dataChan <- nil
					close(dataChan)
					return
				}
				if file == nil {
					dataChan <- nil
					close(dataChan)
					return
				}
				data, _ := io.ReadAll(file)
				dataChan <- data
				close(dataChan)
			}, m.parent)
		fopenDialog.Resize(fyne.NewSize(500, 500))
		fopenDialog.Show()
	}()
	return <-dataChan
}

